/* ðŸŒˆ This is the client side ðŸŒˆ*/

/* dependencies */
import fetch from "isomorphic-unfetch";

/* layout */
import DefaultLayout from "../../components/layouts/DefaultLayout";

/* components */

import BlogPost from '../../components/modules/BlogPost';
import Navbar from '../../components/NavBar';

function fetchUrl(url) {
  return fetch(url).then(r => r.json());
}


const Page = ({ data }) => {
  const { content } = data;
  const blogPostData = content.components.find((item) => item.component === 'Blogpost');


  return (
    <DefaultLayout>
      <Navbar/>
      <h1>Slug page</h1>
      {blogPostData ? <BlogPost title={blogPostData.Title} intr={blogPostData.Intro} body={blogPostData.Body} /> : null}

    </DefaultLayout>
  );
};


Page.getInitialProps = async ({ query }) => {
  const { page } = query;
  const data = await fetchUrl(`http://localhost:3000/api/page/${page}`);
  return { data }; 
};

export default Page;
